import {Button} from 'react-bootstrap';
import {Entry} from './pages/entry/Entry.Page'
import {DefaultLayout} from './layout/default-layout/DefaultLayout'
import "./App.css"
import { Dashboard } from './pages/dashboard/Dashboard.page';
import { AddTicket } from './pages/new-ticket/addTicketpage';
import { TicketList } from './pages/ticket-listing/TicketList.page';
import { Ticket } from './pages/ticket/Ticket.Page';
// import { PrivateRoute } from './pages/components/private-route/PrivateRoute.comp';
import{BrowserRouter as Router,Switch,Route,Link} from "react-router-dom";
function App() {



  return (

    <div className="App">
  <Router>

    <Switch>
    <DefaultLayout>
  <Route  exact path="/" >{ <Entry></Entry>}</Route>
  <Route path="/dashboard">{<Dashboard></Dashboard>}</Route>
  <Route path="/add-ticket">{<AddTicket></AddTicket>}</Route>
  <Route path="/tickets">{<TicketList></TicketList>}</Route>
  </DefaultLayout>
    </Switch>



    {/* < */}
  {/* <Dashboard></Dashboard> */}
  {/* <AddTicket></AddTicket> */}
  {/* <TicketList></TicketList> */}
  {/* <Ticket></Ticket> */}
  {/* </DefaultLayout> */}




  </Router>




    </div>
  );
}

export default App;
